$(document).ready(function(){
    var cost = $('#cost span').value;
    $('#order_rental_period').on('change',function() {
        var hours = document.getElementById("#order_rental_period").value;
        alert(hours);
        document.getElementById("cost").innerHTML = 12 * hours;
    });
})
